import React from "react";
import { TypeAnimation } from "react-type-animation";

export const Home = () => {
    return (
        <main className="headerheight">
            <div className="banner home-banner">
                <div className="container">
                    <div className="flex">
                        <div className="colA">
                            <div className="content">
                                <h1>Unveiling the Art of Web
                                    <TypeAnimation
                                        sequence={[
                                            "Development",
                                            1500,
                                            "Design",
                                            1500,
                                        ]}
                                        wrapper="span"
                                        cursor={true}
                                        repeat={Infinity}
                                        speed={250}
                                        style={{ display: 'block' }}

                                    /></h1>
                                    <div className="btn"><button>Explore<br></br> Now</button></div>
                            </div>
                        </div>
                        <div className="colB">
                            <figure>
                                <img src={require('../assets/images/home/banner-img.png')} alt="" />
                            </figure>
                        </div>
                    </div>
                </div>
            </div>
        </main>
    );
};
